cy.get('#speed').select('Slow').should($el => {
  expect($el.val()).to.eql('2');
  expect($el.find("option:selected").text()).to.eql('Slow');
}); //Cypress Way of handling
cy.get('#speed').select('Slow').find('option:selected').as('selectedvalue');
